import React from 'react';
import Link from 'next/link';

const NavBar = () => {
	return (
		<div>
			<ul>
				<li>
					<Link href="/">
						<a>Home</a>
					</Link>
				</li>
				<li>
					<Link href="/about">
						<a>About</a>
					</Link>
				</li>
			</ul>
		</div>
	);
};

export default NavBar;
